                {/*        </Link>*/}
                {/*    </li>*/}
                {/*    <li className="nav-item">*/}
                {/*        <Link route="category.index">*/}
                {/*            <a className="nav-link">Categorieen</a>*/}
                {/*        </Link>*/}
                {/*    </li>*/}
                {/*    <li className="nav-item">*/}
                {/*        <a className="nav-link disabled" href="#">Disabled</a>*/}
                {/*    </li>*/}
                {/*</ul>*/}
            </div>
        </div>
    </nav>
)

export default Nav
